item = item.body;
let tempstamp = item.timestamp.split(' ').slice(0, 2).join(' ');
let stamp = new Date(tempstamp);
item.timestamp = (stamp.getMonth() + 1) + "/" + stamp.getDate()+ "/" + stamp.getFullYear() + " " + stamp.getHours() + ":" + parseMinute(stamp.getMinutes()) + ":" + stamp.getSeconds();
let tempcreated = item.timecreated.split(' ').slice(0, 2).join(' ');
let created = new Date(tempcreated);
item.timecreated = (created.getMonth() + 1) + "/" + created.getDate()+ "/" + created.getFullYear() + " " + created.getHours() + ":" + parseMinute(created.getMinutes()) + ":" + created.getSeconds();
if(item.bizid.length > 0){
  item.bizid = parseInt(item.bizid);
}
if(item.actualunits.length > 0){
  item.actualunits = parseInt(item.actualunits);
}

function parseMinute(input){
  if(input < 10){
    return `0${input}`;
  }
  return input;
}

return item;
